    public static List<string> bagfinder(List<string> input, string bagKey)
    {
        var bagFound = new List<string>();
        foreach (string rule in input)
        {
            var ruleParts = rule.Split(new string[] { " : " }, StringSplitOptions.None).ToList();

            if (ruleParts[1].Contains(bagKey))
            {
                bagFound.Add(ruleParts[0]);
            }
        }
        var tempBagFound = new List<string>();
        foreach (string bag in bagFound)
        {
            tempBagFound.AddRange(bagfinder(input, bag));
        }
        bagFound.AddRange(tempBagFound);
        return bagFound;
    }

    public List<string> bagCounter(List<string> input, string bagKey)
    {
        var bagFound = new List<string>();
        foreach (string rule in input)
        {
            var ruleParts = rule.Split(new string[] { " : " }, StringSplitOptions.None).ToList();

            if (ruleParts[0] == bagKey)
            {
                var contains = ruleParts[1].Split(',');
                foreach (string bag in contains)
                {
                    if (bag.Trim(' ') != "no other")
                    {
                        bagFound.Add(bag.Trim(' '));
                    }
                }
            }
        }
        var tempBagFound = new List<string>();
        foreach (string bag in bagFound)
        {
            Console.WriteLine(bag);
            var bagNumber = Int32.Parse(bag.Trim(' ').Substring(0, 1));
            BagCounter += bagNumber;
            for (int i = 0; i < bagNumber; i++)
            {
                tempBagFound.AddRange(bagCounter(input, bag.Substring(2)));
            }
        }
        bagFound.AddRange(tempBagFound);
        return bagFound;
    }
